
<!DOCTYPE html>
<html>
<head>
    <title>Plymouth (BBox) Interactive Risk Map</title>
    <meta charset="utf-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <link rel="stylesheet" href="https://unpkg.com/leaflet@1.9.4/dist/leaflet.css" />
    <script src="https://unpkg.com/leaflet@1.9.4/dist/leaflet.js"></script>
    <style>
        html, body { height: 100%; }
        body {
            margin: 0;
            padding: 0;
            font-family: Arial, sans-serif;
            height: 100%;
        }
        #map {
            position: absolute;
            top: 0;
            right: 0;
            bottom: 0;
            left: 0;
            width: 100%;
            height: 100%;
        }
        .leaflet-container { height: 100% !important; }
        #control-panel {
            position: fixed;
            top: 16px;
            right: 12px;
            width: 300px;
            max-height: 86vh;
            overflow-y: auto;
            background: rgba(255, 255, 255, 0.96);
            padding: 14px;
            border-radius: 10px;
            box-shadow: 0 2px 12px rgba(0,0,0,0.2);
            z-index: 1000;
        }
        #control-panel h3 {
            margin: 0 0 10px 0;
            color: #2c3e50;
            font-size: 16px;
        }
        .control-item {
            margin-bottom: 12px;
        }
        .control-item label {
            font-weight: bold;
            color: #34495e;
            font-size: 12px;
        }
        .control-item .value {
            float: right;
            color: #e74c3c;
            font-weight: bold;
            font-size: 12px;
        }
        .slider {
            width: 100%;
            margin-top: 4px;
        }
        .btn {
            padding: 6px 10px;
            border: none;
            border-radius: 4px;
            cursor: pointer;
            font-weight: bold;
            font-size: 12px;
        }
        .btn-weather {
            float: right;
            background: #3498db;
            color: white;
        }
        .btn-weather.wet {
            background: #34495e;
        }
        .btn-update {
            width: 100%;
            background: #27ae60;
            color: white;
            padding: 8px;
            font-size: 12px;
            margin-top: 8px;
        }
        .btn-update:hover {
            background: #229954;
        }
        .stats {
            font-size: 11px;
            color: #7f8c8d;
            line-height: 1.4;
        }
        .stats b {
            color: #2c3e50;
        }
        hr {
            border: none;
            border-top: 1px solid #ecf0f1;
            margin: 10px 0;
        }
        #legend {
            position: fixed;
            bottom: 16px;
            left: 12px;
            background: rgba(255, 255, 255, 0.96);
            padding: 10px;
            border-radius: 8px;
            box-shadow: 0 2px 8px rgba(0,0,0,0.18);
            z-index: 1000;
            max-width: calc(100vw - 24px);
            max-height: none;
            overflow: visible;
        }
        #legend .legend-scale {
            height: 120px;
            width: 16px;
        }
        #legend h4 {
            margin: 0 0 6px 0;
            color: #2c3e50;
            font-size: 12px;
        }
        #legend small {
            display: block;
            max-width: 220px;
            line-height: 1.2;
        }
        #legend .legend-labels {
            height: 120px;
        }
        .legend-item {
            margin: 5px 0;
            font-size: 12px;
        }
        .legend-color {
            width: 30px;
            height: 12px;
            display: inline-block;
            margin-right: 8px;
            border: 1px solid #ccc;
        }
        @media (max-width: 768px) {
            #control-panel {
                top: 8px;
                right: 8px;
                left: auto;
                width: 220px;
                max-height: 40vh;
                padding: 8px;
                border-radius: 8px;
            }
            #control-panel h3 {
                font-size: 13px;
                margin-bottom: 6px;
            }
            .control-item {
                margin-bottom: 8px;
            }
            #legend {
                left: 8px;
                bottom: 8px;
                padding: 6px;
                max-width: calc(100vw - 16px);
            }
            #legend h4 {
                font-size: 11px;
            }
            #legend small { max-width: 180px; }
            #legend .legend-labels { height: 96px; }
            #legend .legend-scale {
                height: 96px;
                width: 14px;
            }
            .btn-update {
                padding: 6px;
            }
            .stats {
                font-size: 10px;
            }
        }
        /* Additional small-screen adjustments for general mobile readability */
        @media (max-width: 991px) {
            #control-panel { width: 200px; padding: 8px; top: 8px; right: 8px; }
            #legend { left: 8px; bottom: 8px; padding: 6px; }
            #map { position: absolute; top: 0; bottom: 0; width: 100%; }
        }

        @media (max-width: 576px) {
            #control-panel { width: 180px; max-height: 36vh; padding: 6px; }
            #legend { padding: 8px; font-size: 10px; top: 8px; bottom: auto; left: 6px; display: inline-block; min-height: 150px; }
            #legend h4 { font-size: 11px; margin-bottom: 4px; }
            #legend .legend-scale {
                height: 110px;
                width: 12px;
            }
            #legend .legend-labels { height: 110px; font-size: 8px; }
            #legend small { max-width: 150px; font-size: 9px; }
        }
    </style>
</head>
<body>
    <div id="map"></div>
    
    <div id="control-panel">
    <h3>Plymouth Temporal Risk Map</h3>
        
        <div class="control-item">
            <label>Day of Year:</label>
            <span class="value" id="day-display">Jan 1 (Weekday)</span><br>
            <input type="range" class="slider" id="day-slider" min="1" max="365" value="1">
        </div>
        
        <div class="control-item">
            <label>Hour:</label>
            <span class="value" id="hour-display">12:00</span><br>
            <input type="range" class="slider" id="hour-slider" min="0" max="23" value="12">
        </div>
        
        <hr style="margin: 15px 0;">
        
        <div class="control-item">
            <label>üé¨ Animation:</label><br>
            <button class="btn btn-update" id="play-btn" onclick="togglePlayPause()" style="width: 100%; margin-bottom: 10px;">
                ‚ñ∂Ô∏è Play Through Year
            </button>
            <div style="margin-top: 10px;">
                <label style="font-size: 12px;">Speed:</label>
                <select id="speed-select" onchange="updateAnimationSpeed()" style="width: 100%; padding: 6px; border-radius: 5px; border: 1px solid #ccc; margin-top: 3px;">
                    <option value="2000">Slow (2s per day)</option>
                    <option value="500" selected>Normal (0.5s per day)</option>
                    <option value="250">Fast (0.25s per day)</option>
                    <option value="100">Very Fast (0.1s per day)</option>
                </select>
            </div>
            <button class="btn btn-update" id="manual-update-btn" onclick="manualUpdate()" style="width: 100%; margin-top: 10px;">
                üîÑ Update Map
            </button>
        </div>
        
        <hr>
        
        <div class="stats">
            <div style="margin-bottom: 10px; padding: 8px; background: #f7f9fc; border-radius: 6px; border: 1px solid #e1e6ef;">
                <div style="font-weight: bold; font-size: 12px; margin-bottom: 4px;">Crash stats (2021‚Äì2024)</div>
                <div><b>Total crashes:</b> 177</div>
                <div><b>Avg crashes/day:</b> 0.12</div>
                <div><b>Predicted crashes/day:</b> 0.13</div>
                <div style="color:#666; margin-top:2px;">(expected = rate √ó exposure/day)</div>
            </div>
        </div>
    </div>
    
    <div id="legend">
        <h4 id="legend-title">Risk Gradient</h4>
        <small style="color: #666;" id="legend-subtitle">Rate: crashes per MVKT</small>
        <div style="margin: 6px 0; display: flex; align-items: center;">
            <div class="legend-scale" style="background: linear-gradient(to bottom, 
                #d7191c 0%,
                #ffff66 33%,
                #00cc66 66%,
                #2c7bb6 100%);
                border: 1px solid #ccc;
                border-radius: 3px;
                display: inline-block;
            "></div>
            <div class="legend-labels" style="display: inline-flex; flex-direction: column; justify-content: space-between; height: 120px; margin-left: 6px; font-size: 10px;">
                <div><b id="legend-90">-</b><br>High</div>
                <div><b id="legend-10">-</b><br>Low</div>
            </div>
        </div>
    </div>
    </div>

                currentWet
            );
            const adjustedRate = baseline * multiplier;
            layer.bindTooltip(`${feature.properties.ref_type || 'Road'} - Rate: ${adjustedRate.toFixed(2)} crashes/MVKT`);
        }
        
        // Initialize layer
        function initializeLayer() {
            if (geoJsonLayer) {
                map.removeLayer(geoJsonLayer);
            }
            
            geoJsonLayer = L.geoJSON(geojsonData, {
                style: styleFeature,
                onEachFeature: onEachFeature
            }).addTo(map);
            
            updateLegend();
            updateStatistics();
        }
        
        // Update legend (absolute risk only)
        function updateLegend() {
            const globalPercentiles = percentiles['absolute']['all'];
            document.getElementById('legend-title').textContent = mapMode === 'crash_density'
                ? 'Crash Density'
                : 'Absolute Risk';
            document.getElementById('legend-subtitle').textContent = mapMode === 'crash_density'
                ? 'Crashes per km'
                : 'Crashes per MVKT';
            const scaleMax = globalPercentiles['90'] * 1.75;
            document.getElementById('legend-90').textContent = `${scaleMax.toFixed(4)}`;
            document.getElementById('legend-10').textContent = `${globalPercentiles['10'].toFixed(4)}`;
        }
        
        // Update statistics
        function updateStatistics() {
            // Stats panel removed; no-op to avoid missing element errors.
            return;
        }
        
        // Event handlers
        document.getElementById('day-slider').oninput = function() {
            currentDay = parseInt(this.value);
            updateDayDisplay();
            updateStatistics();
        };
        
        document.getElementById('hour-slider').oninput = function() {
            currentHour = parseInt(this.value);
            document.getElementById('hour-display').textContent = 
                currentHour.toString().padStart(2, '0') + ':00';
            updateStatistics();
        };
        
        function manualUpdate() {
            updateStatistics();
            initializeLayer();
        }
        
        // Animation functions
        function animationStep() {
            currentHour++;

            if (currentHour > 23) {
                currentHour = 0;
                currentDay++;
                if (currentDay > 365) {
                    currentDay = 1;
                }
            }

            document.getElementById('day-slider').value = currentDay;
            document.getElementById('hour-slider').value = currentHour;
            updateDayDisplay();
            document.getElementById('hour-display').textContent =
                currentHour.toString().padStart(2, '0') + ':00';
            updateStatistics();
            initializeLayer();
        }
        
        function togglePlayPause() {
            const btn = document.getElementById('play-btn');
            
            if (isPlaying) {
                isPlaying = false;
                clearInterval(animationInterval);
                animationInterval = null;
                btn.textContent = '‚ñ∂Ô∏è Play Through Year';
                btn.style.backgroundColor = '#4CAF50';
            } else {
                isPlaying = true;
                btn.textContent = '‚è∏Ô∏è Pause';
                btn.style.backgroundColor = '#ff9800';
                animationInterval = setInterval(animationStep, animationSpeed);
            }
        }
        
        function updateAnimationSpeed() {
            const speed = parseInt(document.getElementById('speed-select').value);
            animationSpeed = speed;
            if (isPlaying) {
                clearInterval(animationInterval);
                animationInterval = setInterval(animationStep, animationSpeed);
            }
        }
        
    // Initialize
    updateDayDisplay();
    initializeLayer();
    </script>
    <!-- Mobile controls: toggle button + small positioning tweaks -->
    <style>
        /* Floating toggle button for small screens */
        #panel-toggle {
            display: none;
            position: fixed;
            right: 12px;
            bottom: 12px;
            z-index: 1101;
            background: #2563eb;
            color: #fff;
            border: none;
            padding: 10px 12px;
            border-radius: 999px;
            box-shadow: 0 8px 20px rgba(0,0,0,0.18);
            font-weight: 700;
        }

        @media (max-width: 576px) {
            #panel-toggle { display: block; }
            /* Move the control panel to the bottom and hide it by default */
            #control-panel {
                left: 50% !important;
                right: auto !important;
                top: auto !important;
                bottom: 6px !important;
                width: 94vw !important;
                max-width: 640px !important;
                transform: translate(-50%, 120%);
                transition: transform 0.28s ease;
                border-radius: 12px 12px 0 0 !important;
            }
            /* When .open, slide it up */
            #control-panel.open {
                transform: translate(-50%, 0%);
            }
            /* Move legend up so it doesn't collide */
            #legend { left: 8px !important; bottom: 120px !important; }
            /* Push leaflet scale above the toggle/control panel */
            .leaflet-control-scale { bottom: 160px !important; left: 8px !important; }
        }
    </style>

    <button id="panel-toggle" aria-controls="control-panel" aria-expanded="false">Controls</button>
    <script>
        // Small toggle to show/hide the control panel on narrow screens
        (function(){
            var btn = document.getElementById('panel-toggle');
            var panel = document.getElementById('control-panel');
            if (!btn || !panel) return;
            btn.addEventListener('click', function(){
                var open = panel.classList.toggle('open');
                btn.setAttribute('aria-expanded', open);
                btn.textContent = open ? 'Close' : 'Controls';
            });
        })();
    </script>
    <script>
        // Listen for parent requests to invalidate the map size (postMessage)
        window.addEventListener('message', function(e){
            if (e && e.data === 'invalidate') {
                // delay slightly to allow layout to settle
                setTimeout(function(){ if (typeof map !== 'undefined' && map && map.invalidateSize) { map.invalidateSize(); } }, 80);
            }
        }, false);
    </script>
</body>
